import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Icon from '@material-ui/core/Icon';
import IconButton from '@material-ui/core/IconButton';
import LinearProgress from '@material-ui/core/LinearProgress';

const styles = theme => ({
  menuButton: {
    marginRight: 7,
    height: 36,
    width: 36,
    padding: 0,
  },
  appbar: {
    height: 48,
    zIndex: theme.zIndex.drawer + 1,
  },
  toolbar: {
    marginLeft: 7,
    marginRight: 7,
  },
  loadingBar: {
    zIndex: theme.zIndex.appbar + 1,
  },
});

class Appbar extends Component {

  render() {
    const { classes } = this.props;

    return (
      <div>
        <LinearProgress varient="indeterminate" color="secondary" classes={{root: classes.loadingBar}} />
        <AppBar position="fixed" classes={{root: classes.appbar}}> 
        {/* <LinearProgress varient="indeterminate" color="secondary" 
          classes={{
            root: classes.loadingBar, 
            barColorSecondary: classes.loadingBarStripe,
            colorSecondary: classes.loadingBarStripe,
            bar2Indeterminate: classes.loadingBarStripe,
            bar: classes.loadingBarStripe,
          }} /> */}
        <Toolbar variant="dense" disableGutters classes={{root: classes.toolbar}}>
          <IconButton color="inherit" aria-label="Menu" classes={{root: classes.menuButton}} onClick={() => this.props.toggleDrawer()}>
            <Icon>menu</Icon>
          </IconButton>
          <Typography variant="h6" color="inherit" className={classes.grow}>
            {this.props.title || 'Untitled'}
          </Typography>
        </Toolbar>
      </AppBar>
      </div>
    );
  }
}

Appbar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles, { withTheme: true })(Appbar);
